<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Home</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Baloo+Bhaijaan+2:wght@400..800&family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&display=swap');
        @import url('https://fonts.googleapis.com/css2?family=Baloo+Bhaijaan+2:wght@400..800&family=Lato:ital,wght@0,100;0,300;0,400;0,700;0,900;1,100;1,300;1,400;1,700;1,900&family=Poppins:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap');

        body{
            margin: 0px;
            overflow: hidden;
        }

        .main{
            width: 100%;
            height: 100vh;
            flex-grow: 1;
            display: flex;
            flex-direction: column;
            margin-top: 0px;
            overflow: hidden;
        }

        h1{
            font-family: 'Baloo Bhaijaan 2', sans-serif;
            font-size: 32px;
            font-weight: 700;
            font-style: normal;
            padding: 10px 10px 0px;
            margin: 0px;
        }

        .all_header {
            display: flex;
            flex-direction: column;
            align-items: flex-start;
        }

        .header{
            display: flex;
            justify-content: space-between;
            align-items: center;
            width: 95%;
            margin-bottom: 20px;
            margin-top: 0px;
        }

        .profile_part {
            display: flex;
            align-items: center;
        }

        .fire {
            display: flex;
            align-items: flex-end;
            margin-right: 10px;
        }

        .profile_icon {
            width: 56px;
            height: 56px;
            border-radius: 50%;
            background-color: #ccc;
            border: 1px solid black;
        }

        .profile_icon img {
            width: 100%;
            height: 100%;
            border-radius: 50%;
            object-fit: cover;
        }

        .user_points {
            font-family: 'Baloo Bhaijaan 2', sans-serif;
            font-size: 16px;
            font-weight: 700;
            margin-left: 5px;
            color: #FD7981;
            line-height: 100%;
            letter-spacing: 0%;
        }

        .all_containers {
            width: 100%;
            height: auto;
            display: flex;
            justify-content: center;
            overflow: hidden;
            flex-wrap: wrap;
            padding-left: 5px;
        }

        .container {
            width: 132px;
            height: 147px;
            border-radius: 20px;
            display: flex;
            flex-direction: column;
            justify-content: space-between;
            padding: 20px 16px 0px 16px;
            margin-right: 10px;
            margin-bottom: 10px;
        }

        #first { background-color: #FEBCC0; }
        #second { background-color: #FFECE8; }
        #third { background-color: #FFE37F; }
        #forth { background-color: #B2D9CB; }
        #fifth { background-color: #FFE3E9; width: 308px; }

        p {
            font-family: 'Baloo Bhaijaan 2', sans-serif;
            font-size: 16px;
            font-weight: 700;
            line-height: 120%;
            color: #2C2C2C;
            font-weight: bold;
            margin: 0px;
        }

        .loading_container {
            width: 100%;
            display: flex;
            align-items: center;
            margin: 8px 0;
        }

        .loading_bar_container {
            width: 90%;
            height: 2px;
            background-color: white;
            border-radius: 10px;
            overflow: hidden;
            position: relative;
        }

        .loading_bar {
            height: 100%;
            background-color: #2C2C2C;
            width: 0;
            border-radius: 10px;
            transition: width 0.3s ease;
        }

        .progress_percentage {
            margin-left: 10px;
            font-family: 'Poppins', sans-serif;
            font-size: 12px;
            line-height: 1;
            letter-spacing: 0;
            color: #2C2C2C;
        }

    </style>
</head>

    document.addEventListener("DOMContentLoaded", function () {
        const progressData = {

            levers: {

                total: {{ progress_data.levers.total }}
            },
            portfolio: {
                completed: {{ progress_data.portfolio.completed }},
                total: {{ progress_data.portfolio.total }}
            }
        };

        function updateProgress(coursesCompleted, totalCourses, loadingBarId, percentageId) {
            const percentage = (coursesCompleted / totalCourses) * 100;
            document.getElementById(loadingBarId).style.width = percentage + '%';
            document.getElementById(percentageId).textContent = Math.round(percentage) + '%';
        }

        updateProgress(progressData.money_talks.completed, progressData.money_talks.total, 'loadingBar1', 'percentage1');
        updateProgress(progressData.reach_girl.completed, progressData.reach_girl.total, 'loadingBar2', 'percentage2');
        updateProgress(progressData.you_do_you.completed, progressData.you_do_you.total, 'loadingBar3', 'percentage3');
        updateProgress(progressData.levers.completed, progressData.levers.total, 'loadingBar4', 'percentage4');
        updateProgress(progressData.portfolio.completed, progressData.portfolio.total, 'loadingBar5', 'percentage5');
    });
